import React from 'react'
import * as headerViews from './header/headerViews'
import * as headerContoller from './header/headerController'
const HeaderContent = () => {
  let topMessage = headerContoller.getHeaderMessage()
  let logo = headerContoller.getSiteLogo()
  let cartValue = 2
  let middle = {
    sitelogo: logo,
    cartItems: cartValue,
  }

  return (
    <React.Fragment>
      <header className='bg-dark'>
        <DropDownCart />
        <HeaderTop topMessage={topMessage} />
        <HeaderMiddle middle={middle} />
        <HeaderNav />
      </header>
    </React.Fragment>
  )
}

// Drop Down Cart Component
const DropDownCart = () => {
  let dropCartContent = headerViews.GetdropCartViews()
  return dropCartContent
}

// Header Top Component
const HeaderTop = (props) => {
  let headerTopContent = headerViews.GetHeaderTopViews(props)
  return headerTopContent
}

// Header Middle Component
const HeaderMiddle = (props) => {
  let headerMiddleContent = headerViews.GetHeaderMiddleViews(props)
  return headerMiddleContent
}

// Header Nav Component
const HeaderNav = () => {
  let headerNavContent = headerViews.GetHeaderNavViews()
  return headerNavContent
}
export default HeaderContent
